import React from "react";
import ExpertCard from "./ExpertCard";
import faker from 'faker'

function ExpertList(){
    return (
        <div>

            <ExpertCard 
                avatar = {faker.image.avatar()}
                name = {faker.name.firstName()}
                description ={faker.name.jobTitle()}
                rating = " 5 stars"
            />

        </div>
    )
}

export default ExpertList
